import React, { useEffect, useState } from "react";
import Navbar from "../components/Navbar";
import MovieTendance from "../components/MovieTendance";
import axios from "axios";

const Acceuil = () => {
  const [movieTendnace, setMovieTendance] = useState([]);

  useEffect(() => {
    axios
      .get(
        "https://api.themoviedb.org/3/discover/movie?api_key=864b6602f4018630491e67fa714381e6&query=a&page=1&language=fr-FR"
      )
      .then((res) => setMovieTendance(res.data.results));
  }, []);

  return (
    <div className="acceuil">
      <Navbar />
      <div className="img-acceuil">
        <img src="./img/interstelar.jpeg" alt="" />
        <h3>
          <span>Bienvenue,</span>
          <br />
          Des millions de films, émissions télévisées et artistes...
        </h3>
      </div>
      <MovieTendance />
    </div>
  );
};

export default Acceuil;
